"   </div>",
"   <div class=\"lgnd\">",
"    Transesophageal echocardiography transverse view&nbsp;of traumatic subadventitial rupture of the aortic isthmus. There is a thick and highly mobile medial flap associated with a localized deformity of the anterolateral aortic wall due to the acute formation of a pseudoaneurysm (small arrow). The flap is thicker than the intimal flap seen with aortic dissection, since the entire depth of the intima and media are involved with aortic rupture.",
